import { useEffect } from "react";

const Dashboard = () => {
    useEffect(() => {
        const greeting = () => {
            // get time
            let time = new Date().getHours;
            console.log(time.getHours());
            // convert the time to a 24hr stuff
            // if t < 12AM (morning)
            // if t > 12AM but less than  18AM (Afternon)
            // if t > 18AM but less than  24AM (Evening)
    
        }
        greeting();
    });
    return (
        <div>Dashboard works!</div>
    );
}
export default Dashboard;
